import React, { useState, useEffect } from 'react'

function index() {
    const [urldate, setUrldate] = useState(null)
    useEffect(() => {
        const a = window.location.pathname
        var reg = /(?=\/)/g;
        var ssa = null
        a.replace(reg, ($, $1) => {
            ssa = a.slice($1 + 1)
        })

        setUrldate(ssa)

    }, [])
    return (
        <div>
            sdsdsd
        </div>
    )
}

export default index
